<p>Biểu thức chính quy (Regular Expression) sử dụng một chuỗi duy nhất để mô tả và khớp với một loạt các chuỗi phù hợp với một quy tắc cú pháp. Trong nhiều trình chỉnh sửa văn bản, biểu thức chính quy thường được sử dụng để tìm kiếm và thay thế các chuỗi phù hợp với một mẫu.</p>
